                <Container>
                    <Typography style={
                    {
                        textAlign: "center", 
                        fontFamily: "monospace",
                        fontSize: 60,
                    }}
                    >
                        Portfolio
                    </Typography>
                </Container>    

                <span id="clock"></span>
                </header>
        </div>
    );
}
export default Portfolio
